import { useContext } from 'react';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import { auth } from '../firebase';
import { AuthContext } from '../Auth';

function Home() {
  const { currentUser } = useContext(AuthContext);
  const navigate = useNavigate();
  const handleSignOut = async () => {
    try {
      await auth.signOut();
      navigate('/signin')
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <div>
      <h1>Hi</h1>
      {currentUser ? <p>Welcome, {currentUser?.displayName}!</p>: <p>Welcome, Guest!</p>}
      <button onClick={handleSignOut}>Log Out</button>


      <div>
        <h2>Top Trending Stocks</h2>
        <ul>
          <li>
            <a href="#">AAPL</a> - Apple Inc.
          </li>
          <li>
            <a href="#">GOOG</a> - Alphabet Inc.
          </li>
          <li>
            <a href="#">AMZN</a> - Amazon.com Inc.
          </li>
        </ul>
      </div>
      <div>
        <h2>Featured Articles</h2>
        <ul>
          <li>
            <a href="#">The Rise and Fall of GameStop Stock</a>
          </li>
          <li>
            <a href="#">Tesla's Record-Breaking Stock Performance</a>
          </li>
          <li>
            <a href="#">How Cryptocurrency is Changing the Stock Market</a>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Home;
